import React, { useState } from "react";
import { useNavigate } from "react-router-dom"; // Asegúrate de que esto está importado

import "bootstrap/dist/css/bootstrap.min.css";

const Register = () => {
  const navigate = useNavigate(); // Define navigate usando el hook useNavigate

  const [formData, setFormData] = useState({
    primerNombre: "",
    segundoNombre: "",
    primerApellido: "",
    segundoApellido: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    ubicacion: {
      lugar: "",
      ciudad: "",
      departamento: "",
    },
    usuario: {
      login: "",
      password: "",
    },
  });

  const [alertInfo, setAlertInfo] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [modalMessage, setModalMessage] = useState("");
  const [modalType, setModalType] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name.startsWith("usuario.")) {
      const usuarioField = name.split(".")[1];
      setFormData((prevData) => ({
        ...prevData,
        usuario: { ...prevData.usuario, [usuarioField]: value },
      }));
    } else if (name.startsWith("ubicacion.")) {
      const ubicacionField = name.split(".")[1];
      setFormData((prevData) => ({
        ...prevData,
        ubicacion: { ...prevData.ubicacion, [ubicacionField]: value },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const currentDate = new Date();
    const selectedDate = new Date(formData.fechaNacimiento);
    const year = selectedDate.getFullYear();

    if (selectedDate > currentDate) {
      setAlertInfo({ type: "danger", message: "La fecha de nacimiento no puede ser futura." });
      return;
    }

    if (year < 1900 || year > 2100) {
      setAlertInfo({ type: "danger", message: "El año de nacimiento debe estar entre 1900 y 2100." });
      return;
    }

    const dataToSend = {
      ...formData,
      identificacion: parseInt(formData.identificacion),
    };

    try {
      const response = await fetch("http://localhost:9001/Laboratorio1/persona", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(dataToSend),
      });

      let responseData;
      const contentType = response.headers.get("content-type");
      if (contentType && contentType.includes("application/json")) {
        responseData = await response.json();
      } else {
        responseData = await response.text();
      }

      if (response.ok) {
        setModalMessage(typeof responseData === "object" ? responseData.message : responseData);
        setModalType("success");
        setShowModal(true);
        // Redirigir a la página de inicio después de 2 segundos
        setTimeout(() => {
          navigate("/"); // Usa navigate para redirigir
        }, 2000);
      } else {
        setModalMessage(typeof responseData === "object" ? responseData.message : responseData);
        setModalType("error");
        setShowModal(true);
      }
    } catch (error) {
      console.error("Error:", error);
      setModalMessage("Error en la solicitud.");
      setModalType("error");
      setShowModal(true);
    }
  };

  const handleCloseModal = () => {
    setShowModal(false);
  };

  return (
    <div className="container-fluid py-5" style={{ background: "linear-gradient(to right, #212531, #c9b1ff)", minHeight: "100vh" }}>
      <div className="row justify-content-center">
        <div className="col-md-8">
          <div className="card">
            <div className="card-header bg-primary text-white">
              <h2 className="mb-0">Registrar Persona</h2>
            </div>
            <div className="card-body">
              {alertInfo && (
                <div className={`alert alert-${alertInfo.type}`} role="alert">
                  {alertInfo.message}
                </div>
              )}
              <form onSubmit={handleSubmit}>
                {/* Aquí sigue el formulario de registro */}
                <div className="row mb-3">
                  {/* Primer Nombre */}
                  <div className="col-md-6">
                    <label className="form-label">Primer Nombre:</label>
                    <input
                      type="text"
                      name="primerNombre"
                      className="form-control"
                      value={formData.primerNombre}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  {/* Segundo Nombre */}
                  <div className="col-md-6">
                    <label className="form-label">Segundo Nombre:</label>
                    <input
                      type="text"
                      name="segundoNombre"
                      className="form-control"
                      value={formData.segundoNombre}
                      onChange={handleChange}
                    />
                  </div>
                </div>

                {/* Modal */}
                {showModal && (
                  <div className="modal" tabIndex="-1" role="dialog" style={{ display: "block" }}>
                    <div className="modal-dialog" role="document">
                      <div className={`modal-content ${modalType === "success" ? "bg-success" : "bg-danger"}`}>
                        <div className="modal-header">
                          <h5 className="modal-title text-white">
                            {modalType === "success" ? "Éxito" : "Error"}
                          </h5>
                          <button type="button" className="btn-close" onClick={handleCloseModal}></button>
                        </div>
                        <div className="modal-body">
                          <p className="text-white">{modalMessage}</p>
                        </div>
                        <div className="modal-footer">
                          <button type="button" className="btn btn-secondary" onClick={handleCloseModal}>
                            Cerrar
                          </button>
                        </div>
                      </div>
                    </div>
                  </div>
                )}

                <button type="submit" className="btn btn-primary">
                  Registrar
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
